drop table new_Emp;
drop table new_Dept;


CREATE TABLE new_dept(
   deptno NUMBER(4) NOT NULL,
   dname VARCHAR(20) NOT NULL,
   loc VARCHAR(20),
   CONSTRAINT new_dept_pk PRIMARY KEY (deptno)
);

CREATE TABLE new_emp(
  empno NUMBER(4) NOT NULL,
  ename VARCHAR(40),
  job VARCHAR(20),
  mgr NUMBER(4),
  hiredate DATE,
  sal NUMBER(7, 2),
  comm NUMBER(7, 2),
  deptno NUMBER(4),
  CONSTRAINT new_emp_pk PRIMARY KEY (empno),
  CONSTRAINT new_emp_deptno_fk FOREIGN KEY (deptno) REFERENCES New_Dept (deptno)
);

commit;
